  [],\n\t\"revision_timestamp\": \"2015-09-27T02:39:43.194506\",\n\t\"name\": \"ocean-surface-topography-mission-ostm-jason-2-and-jason-3-data-documentation-records-nodc-acces\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"OSTM/JASON-2 and Jason-3 (scheduled for
  launch in 2015) are follow-on missions continuing the TOPEX/Poseidon and Jason-1
  missions, and are designed to ensure continuity of high quality measurements for
  ocean science and to provide operational products for assimilation and forecasting
  applications. The Jason-2 satellite was launched on 20 June 2008 and reached its
  nominal repetitive orbit on 4 July 2008.nnThese files are data documentation (metadata)
  files for geophysical data records (GDR) and associated ancillary and auxiliary
  data for the OSTM/Jason missions archived at the NODC. The metadata were most recently
  produced according to the International Standards Organization 19115-2 (ISO 19115-2,
  v. 05/2014) standard and are in .xml format. Older versions of metadata in Federal
  Geographic Data Committee format as well as the most current versions are included
  in this metadata collection, along with .pdf copies of related handbooks. Data files
  are available at the NODC under separate accession numbers.\",\n\t\"license_title\":
